import '././Styles/Weather.css';


class Weather extends Component{
    constructor(props){
super(props);

    }
    render(){
        return(
            <div className="container">
         <h1>Weather Report</h1>
          <form>
           
           <input type="text" class="input" placeholder="Please enter area name"/>
           <input type="submit" class="submit"/>
           </form>
           <div class="error"></div>
           <div>
               <ul id="listItems">
                   
               </ul>
               </div>
       </div>
        
        )
    }
}


export default Weather;
